B.GA=new A.pj("Learn about sustainable cities","Explore different parts of Gomiland to understand how the city achieves sustainability.\n\nRead the signs to learn about each location. Talk to residents to get more tips on how you can be more environmentally friendly. Get ideas on how you can incorporate steps to contribute to sustainability in your city and daily life!","assets/images/landing/cafe.jpg","assets/images/landing/e_charging.gif",B.ex,null)
B.oj=new A.Q(4284631329)
B.GB=new A.pj("Help out the residents","Some of the residents in town need assistance.\n\nUse your map to locate people needing help. Mr Stark here needs materials for his construction. His machines will appear and start building when you collect enough recyclables!\n\nBonus: Complete all the quests to erect the eco-warrior statue on the Castle Grounds.","assets/images/landing/stark.jpg","assets/images/landing/builders.gif",B.oj,null)
B.GC=new A.pj("Welcome to Gomiland!",'Gomiland is a bustling, sustainable city and home to over 100 people. Join the residents in their quest to achieve zero-waste by picking up and sorting rubbish.\n\nRubbish can be found in all sorts of places. Under trees, around buildings, along paths and on the sidewalks.\n\nMovement: Use the joystick for mobile, "wasd" keys for web.\nInteract: Virtual button for mobile, "e" key for web.',"assets/images/landing/florence.png","assets/images/landing/collect_rubbish.gif",B.ex,null)
B.kb=new A.Q(4281947689)
B.GD=new A.pj("Visit the National Park","Gomiland National Park is home to many protected species of flora and fauna. The residents love strolling about here and you would too!\n\nFind points-of-interests like the World Forest, Bee Colony, Castle grounds and Bamboo Forest Shrine.\n\nBonus: It's Sakura season in a few days. Be sure to find a nice spot to take pictures and enjoy the beautiful sight!","assets/images/landing/forest_shrine.jpg","assets/images/landing/sakuras.gif",B.kb,null)
B.kd=new A.Q(4284159767)
B.GE=new A.pj("Sort rubbish in a fun way","The city has given you 6 bins to throw your rubbish.\n\nLearn about the materials each item is made of, then start sorting! \n\nGet coins for correct sorting and fines for incorrect sorting. Coins can buy useful items and objects for your zen garden!","assets/images/landing/sorting.jpg","assets/images/landing/sort_rubbish.gif",B.kd,null)
